pan></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n<p>\n	<span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;">A seq&uuml;&ecirc;ncia est&aacute; correta em:</span></p>\n', 67, NULL, '2010-06-23 22:30:06', NULL, NULL);
